@jacobandco X Bugatti Chiron watches are custom designed by collectors by either their favorite color combination or to match their own Bugatti Chiron. The custom design brings owning the Bugatti Chiron Tourbillon to a whole new personalized level.

The Bugatti Chiron Tourbillon was made to represent the powerful W16 engine to be showcased on the wrist. It took almost a full year of development to create this jaw dropping timepiece.

This is why @jacobandco are known for their phenomenal watchmaking skills, they have created a true engine on the wrist. #jacobandco
